Seduced by a cougar - Diana Prince

Actors: Diana Prince, Dane Cross

Release Date: November 17, 2010

Who: Client, Cougar, Stranger,

Where: Couch, Warehouse,

Diana Prince is all ready for a hip art show when she finds out from the promoter that she's a week late. The show was in his work/live studio and now Diana is all alone with the artist, who she kinda has a thing for. He asks her to leave but Diana won't until she gets to check out all of his equipment...
